export const ApiUrl: string = "https://reqres.in/api/products";

export const FetchApi = async (params: string = "") => {
    const response = await fetch(`${ApiUrl}${params}`).catch((err) =>
        console.log(err)
    );
    if (!response.ok) {
        return { error: "Something went wrong: " + response.status };
    }
    const data = await response.json();
    return data;
};
